" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 533px\">",
"   <div class=\"ttl\">",
"    Supraspinatus active abduction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 513px; height: 178px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Start in a standing position with both arms fully extended at the elbow, arms at a 45 degree angle from the body and thumbs pointing up to the sky. Raise both arms to the height of the shoulder on a 2 count, slowly return to the starting position on a 4 count, and repeat for a total of 15 repetitions. Make sure to lift from the shoulder; do not allow the shoulder blades to shrug upwards. Rest for 30 seconds and repeat for a total of 3 sets.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Craig Parsons, MS, PT and the Physical Therapy Network.",
"    </div>",
"   </div>",
