var title_f32_33_33310="Coronary flow abnormalities with myocardial bridging";
var content_f32_33_33310=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F55472&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F55472&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Coronary flow abnormalities with myocardial bridging",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 391px; height: 473px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The contrasting patterns of variation in vessel area (VA) and coronary flow velocity (CFV) in a normal vessel (N) and in a muscle bridge segment (B). The end of the QRS (black line) represents the start of isometric contraction of the left ventricle and point of opening of aortic valve and the end of the T-wave (red line) represents the end of systole and the point of closure of aortic valve. In the bridged segment, vessel area falls markedly during systole and increases during diastole with a marked early peak in diastolic coronary flow velocity (arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from Ge J, Erbel R, Rupprecht HJ, et al. Circulation 1994; 89:1725.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
