"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Neisseria meningitidis in sputum",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 366px; height: 240px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Gram stain of sputum (x1000) shows inflammatory cells and gram-negative diplococci. Neisseria meningitidis, which is oxidase-positive, grew from this patient's sputum.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
